import { useState } from 'react';
import cmykRgb from 'cmyk-rgb';

const initColor = () => Math.round(Math.random() * 100);

export default function Swatch({ todaysColor }) {
  const { cyan, magenta, yellow, black } = todaysColor;

  const [r, g, b] = cmykRgb([cyan / 100, magenta / 100, yellow / 100, black / 100]);

  console.log(r,g,b);

  return (
    <div
      style={{
      backgroundColor: `rgb(${r}, ${g}, ${b})`,
      height: '100vh',
      width: '100vw',
    }} />
  );
}
